import React from "react";
import "../css/Cell.css";

const Cell = ({rowIndex, colIndex, grid}) => {
    const data = grid[rowIndex][colIndex];
    const color = data === 0 ? 'transparent' : 'white';
    const styledCell = {
        'width': '30px',
        'height': '30px',
        'font-size': '10px',
        'background-color': color,
        'border': '1px solid black',
    }

    return(
        <div style={styledCell}></div>
    );
}

export default React.memo(Cell);
